import React from 'react';
import './App.css';
import styled from "styled-components";
import {BoxPicture} from "./components/BoxPicture/BoxPicture.styled";

function App() {
	return (
		<div className="App">
			<Container>
				<Box color={''}>
					<BoxPicture>
					</BoxPicture>
				</Box>
			</Container>
		</div>
	);
}

export default App;

const Container = styled.div`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
`

type BoxPropsType = {
	color?: string
}

const Box = styled.div<BoxPropsType>`
  width: 300px;
  height: 350px;
  border-radius: 15px;
  background-color: ${props => props.color || '#FFFFFF'};
  box-shadow: 0 4px 20px 5px rgba(0, 0, 0, 0.10);
`
